import React from 'react'
import { useLocation } from 'wouter'

export default function CarouselElements({ parameter, cssSlide, cssBackdrop, cssDivPoster, cssPoster }) {
  let i = -1
  const [, pushLocation] = useLocation()

  const handleClick = e => {
    pushLocation(`/movie/detail/${e.target.id}`)
  }

  return parameter[0].map(() => {
    i++;
    <div className={cssSlide}
      key={parameter[2][i]}>
      <div className={cssDivPoster}
        id={parameter[2][i]} onClick={handleClick}>
        <img
          src={parameter[1][i]} alt='img1' className={cssPoster} />
      </div>
      <img className={cssBackdrop}
        src={parameter[0][i]} alt={`img${i}`} />
    </div>
})
}
